import React from "react";
import "../styles/Contact.css";

const Contact = () => {
  return (
    <div className="contact">
      <contact-heading>Contact Me</contact-heading>
      <p>Email: jschemmanoor.com</p>
      <p>LinkedIn: www.linkedin.com/in/josechemmanoor</p>
    </div>
  );
};

export default Contact;
